import React from 'react'
import './footer.css'
const Footer=()=>{
    return(
        <div className="footer">
            <div className="footer_flex">
                <div className="contact_div">
                    <p className="contact_title">Contact</p>
                    <p className="place_address">WeWorkVi-John Tower 393, Udyog Vihar Phase III, Gurugram, Haryana 122016</p>
                    <p className="tel_address">Tel - +91-7754095388 Email - info@farmart.co</p>
                </div>
            </div>
        </div>
    )
}
export default Footer;
